import { Component, signal } from '@angular/core';
import { votantes } from '../../models/tags.model';
import { single } from 'rxjs';

@Component({
  selector: 'app-registro',
  standalone: true,
  imports: [],
  templateUrl: './registro.component.html',
  styleUrl: './registro.component.scss'
})
export class RegistroComponent {

  ngOnInit() {
    const storedData = localStorage.getItem('listaVotantes');
    if (storedData) {
      const votantesData = JSON.parse(storedData);
      this.votantes.set(votantesData);
    }

    const statusDoc = localStorage.getItem('estadoDoc')
    if (statusDoc) {
      const docDisplayValue = JSON.parse(statusDoc);

      let docDisplay = signal<number>(0)

      docDisplay.set(docDisplayValue);

      console.log(docDisplay())

      this.changeDisplayDoc(docDisplay())
    }

    const statusName = localStorage.getItem('estadoName')
    if (statusName) {
      const nameDisplayValue = JSON.parse(statusName);

      let nameDisplay = signal<number>(0)

      nameDisplay.set(nameDisplayValue);

      console.log(nameDisplay())


      this.changeDisplayName(nameDisplay())
    }

    const statusCode = localStorage.getItem('estadoCode')
    if (statusCode) {
      const codeDisplayValue = JSON.parse(statusCode);

      let codeDisplay = signal<number>(0)

      codeDisplay.set(codeDisplayValue);

      console.log(codeDisplay())

      this.changeDisplayCode(codeDisplay())
    }

    const statusGroup = localStorage.getItem('estadoGroup')
    if (statusGroup) {
      const groupDisplayValue = JSON.parse(statusGroup);

      let groupDisplay = signal<number>(0)

      groupDisplay.set(groupDisplayValue);

      console.log(groupDisplay())

      this.changeDisplayCode(groupDisplay())
    }
  }



  displayDocStatus = signal <string>('display: none;')
  displayNameStatus = signal <string>('display: none;')
  displayCodeStatus = signal <string>('display: none;')
  displayGroupStatus = signal <string>('display: none;')

  votantes = signal <votantes[]>([])

  changeDisplayDoc(value : number) {
    if (value === 0){
      this.displayDocStatus.set ('display: none;')
    }
    else if (value === 1){
      this.displayDocStatus.set ('display: flex;')
    }
  }

  changeDisplayName(value : number) {
    if (value === 0){
      this.displayNameStatus.set ('display: none;')
    }
    if (value === 1){
      this.displayNameStatus.set ('display: flex;')
    }
  }

  changeDisplayCode(value : number) {
    if (value === 0){
      this.displayCodeStatus.set ('display: none;')
    }
    if (value === 1){
      this.displayCodeStatus.set ('display: flex;')
    }
  }

  changeDisplayGroup(value : number) {
    if (value === 0){
      this.displayGroupStatus.set ('display: none;')
    }
    if (value === 1){
      this.displayGroupStatus.set ('display: flex;')
    }
  }



  image = signal<string>("data:image/jpeg;base64,")
}